    Las_Vegas: "https://res.klook.com/image/upload/fl_lossy.progressive,q_65/c_fill,w_480,h_384/cities/liw377az16sxmp9a6ylg.webp"
                    };


const Carsl = () => {
	return (
		<div style={styles}>
			 <Carousel>
               {IMAGE_ARRAY.map((element) =>  <CarslElement />)}
            </Carousel>
		</div>
	  )
}


export default Carsl;
